    @Test
    public void testParsing() {
        GetStopMonitoringServiceResponse result =
                scs.retrieveSiri("a", "b", "c", 1);
        Assertions.assertThat(result).isNotNull();
        Assertions.assertThat(result.getAnswer()).isNotNull();
        Assertions.assertThat(result.getAnswer().getStopMonitoringDelivery()).isNotNull();
        Assertions.assertThat(result.getAnswer().getProducerRef().getValue()).isEqualTo("ISR Siri Server (141.12)");

        Optional<String> opSummary = parseService.parseShortSummary(result);
        Assertions.assertThat(opSummary.isPresent()).isTrue();
        Assertions.assertThat(opSummary.get()).isNotNull().isNotEmpty();

        String summary = opSummary.get();
        Assertions.assertThat(summary.contains("[line")).isTrue();

        for (String line : summary.split("\n")) {
            String[] fields = line.split(",");
            logger.info("timestamp={}", fields[0]);
            logger.info("expectedArrivalTime={}", fields[8]);   // should have date part as well as time part
            logger.info("departureTime={}", fields[6]);   // should have date part as well as time part
            logger.info("recordedAt={}", fields[9]);
            logger.info("dataFrameRef={}", fields[12]);
            logger.info("stopPointRef={}", fields[13]);
            logger.info("vehicleAtStopStr={}", fields[14]);
            logger.info("version={}", fields[fields.length - 1]);
        }
    }

